import PageComponent from "./PageComponent.js";
import ChooseGamemode from "./ChooseGamemode.js";
import EasyMode from "./gameModes/EasyMode.js";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Layout from "./Layout";


export default function App(){



  return(
    <BrowserRouter>
      <Routes>

          <Route path="/" element={<Layout />}>
            <Route path="/" element={<PageComponent />}/>
            <Route path="/ChooseGamemode" element={<ChooseGamemode />}/>
            <Route path="/EasyMode" element={<EasyMode/>}/>
            {/* <Route path="/EasyMode" element={<HardMode/>}/>
            <Route path="/EasyMode" element={<InsaneMode/>}/> */}
          </Route>


      </Routes>
    </BrowserRouter>
  )
}
